const FeedbackOptions = ({ options, onLeaveFeedback }) => {

    return (
        <div className={css.contaoner}>
            {options.map(option => {
                return <button key={nanoid()} name={option} className={css.feedback_btn} type="button" onClick={onLeaveFeedback}>{option}</button>
